const Hero = () => {
  return (
    <header className="bg-dark text-white p-5">
      <h1>This is a hero component</h1>
    </header>
  )
}

const HomeView = () => {
  return (
    <div>
      <Hero />
      <p>
        Hello World. This is a Home Page
      </p>
    </div>
  )
}

export default HomeView;
